(1, 'Audi Albania', 'Audi AG(part of Volkswagen Group)', 'Porsche Albania sh.p.k., Tirane-Durres Highway, Km 3 Mezez, Albania  Tel: +355 (04) 240 74 30 Fax: +355 (04) 240 74 34 ', 'Audi AG, D-85045, Ingolstadt, Germany Tel: +3800 283 44 44 ', 'Passenger Vehicles', 'http://en.wikipedia.org/wiki/Audi', 'http://www.audi.al/al/brand/sq.html', 'Audi Albania is represented by Porsche as the exclusive importer. Porsche Albania is part of the Austrian Porsche Holding Salzburg.', NULL),
(2, 'Audi Armenia', 'Audi AG(part of Volkswagen Group)', 'Slav Motors CJSC, Adm. Isakov 22/2, 0004 Yerevan, Armenia Tel.: + 374-10-739400 Fax: +374-10-739403', 'Audi AG, D-85045, Ingolstadt, Germany Tel: +3800 283 44 44 ', 'Passenger Vehicles', 'http://en.wikipedia.org/wiki/Audi', 'www.audi.com/com/brand/en/country_locator/Armenia.html?', '""Slav Motors"" CJSC is the exclusive importer of Audi AG in Armenia. Import and sale with 2 years of warranty of all the models of Audi, as well as import and sale of all types of  spare parts and accessories, maintenance and repair of Audi cars', NULL),
(3, 'Audi Austria', 'Audi AG (part of Volkswagen Group)', 'Porsche Austia GmBH & Co OG, 5021, Salzburg Tel: +43-1-86-666 ', 'Audi AG, D-85045, Ingolstadt, Germany Tel: +3800 283 44 44 ', 'Passenger Vehicles', 'http://en.wikipedia.org/wiki/Audi', 'http://www.audi.at', 'Since 1974, Porsche Austria (a company of Porsche Holding) is the importer for Audi in Austria.Today, Audi has a market share of 5.5% (2010) in Austria.Throughout Austria 75 authorized Audi dealer take care of the sale of vehicles and customer service. ', NULL),
